script: |
  super -f text -I q67.spq | sort > q67.out

inputs:
  - name: q67.spq
    data: |
      SELECT DISTINCT - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 * + col1 NOT BETWEEN - 82 AND ( col0 );
  - name: tab0

outputs:
  - name: q67.out
    data: |
      -1
      -21
      -81
